import ProductInfo from './ProductInfo';

const ProductDetails = () =>{
    const productData = {
        name: 'T-SHIRT',
        price: '$ 399.00',
        description: 'A Stylish T-SHIRT',
    };
    return (
        <div>
            <ProductInfo product={productData}/>
        </div>
    );
};

export default ProductDetails;
